import React from "react";

function Navbar() {
    return (
        <div className="flex flex-row">
            <a href="#">About</a>
            <form id="main-search-bar" className="w-96 flex flex-row">
                <input className="w-2/3 p-2 border rounded-l-full  rounded-r-none" type="text" placeholder="Search for a product..."></input>
                <button className="w-1/3 p-2 bg-accent" type="submit">Search</button>
            </form>
            <a className="" href="#">Basket</a>
        </div>
    )
}

export default Navbar;
